        _symbol = symbol_;
        _maxSupply = maxSupply_;
        _currentIndex = _startTokenId(); 
        _salt = salt_;   
        _DCFperBlock = 2e18;   
        _totalPower = 46000;
        _startBlockNumber = block.number;    
    }
  



    function MineStatus(address user)public view returns(uint256){
        uint256 difference = block.number.sub(_mineInfo[user][1]).add(1);
        uint256 start = blockStatus(_mineInfo[user][1]);
        uint256 end = blockStatus(block.number);
        uint256 a = start.add(end).mul(difference).div(2);

        uint dcf_amount = a.mul(_mineInfo[user][2]).div(_totalPower);
        return _mineInfo[user][3].add(dcf_amount);       
    }
   


    function blockStatus (uint256 _BlockNumber)public view returns (uint256){
        uint256 a = _DCFperBlock.mul(1e18);   
        uint256 b = _BlockNumber.mul(1e18).div(_startBlockNumber);
        uint256 c = a.div(b);
        return c;    
    }


